import $ from "jquery";

$(document).ready(function() {
  var ammount = 0;
  $.ajax({
    type: "GET",
    url: "http://localhost:4242/api/1.0/length",
    success: function(response) {
      ammount = response;
      for (var i = 0; i < ammount; i++) {
        $.ajax({
          type: "POST",
          url: "http://localhost:4242/api/1.0/get",
          data: {
            itteration: i
          },
          async: false,
          success: function(response) {
            console.log(response);
          },
          error: function() {}
        });
      }
    },
    error: function() {}
  });
});
